import botao from './nav.module.css';


export default function Menuh(){
    
    return(
        <div className={botao.bot_h}>
            <svg height="900" width="90" id="bot">
            <path d="M 160 220 l 105 0"  stroke="yellow" stroke-width="3" fill="none" />
            <path d="M 175 240 l 80 0" stroke="white" stroke-width="3" fill="none" />
            <path d="M 190 260 l 45 0" stroke="white" stroke-width="3" fill="none" />
            </svg>
        </div>
    )
}
